import './App.css';
import { Autocomplete }  from "@mui/lab";
const movies = [
    {title: 'Mean Girls'},
    {title: 'Hackers'},
    {title: 'The Grey'},
    {title: 'Sunshine'},
      {title: 'Ex Machina'},
      ];

function App() {
  return (
    <div className="App">
        <>
          {movies.map((movie, title) => (
          <p key={title}>{movie}</p>))
          }
        </> 
    </div>
  );
}

export default App;
